  const [boxes, setBoxes] = useState(null);
  const up = () =>{
    setBoxes([3,4,5])
  }


  return (
    <div className="App">
      <div className="content">
        <Navbar />
        {boxes && <Grid boxes={boxes}/>}
        <button onClick={() => up()}>{count}</button>
      </div>
    </div>
  );
}

export default App;
